import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams, useHistory } from 'react-router-dom';
import './TelephoneLineView.css';

const TelephoneLineView = () => {
  const [telephoneLine, setTelephoneLine] = useState(null);
  const { id } = useParams();
  const history = useHistory();

  useEffect(() => {
    const fetchTelephoneLine = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/telephone-lines/`, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        setTelephoneLine(response.data);
      } catch (error) {
        console.error('Error fetching Telephone Line:', error.message);
        alert('Failed to fetch telephone line: ' + error.message);
      }
    };

    fetchTelephoneLine();
  }, [id]);

  if (!telephoneLine) return <div>Loading...</div>;

  return (
    <div className="telephone-line-view-container">
      <button className="telephone-line-view-back-button" onClick={() => history.push('/telephone-lines')}>
        &#x21a9;
      </button>
      <h1 className="telephone-line-view-title">Telephone Line Details</h1>
      <p>Numero de GSM: {telephoneLine.numero_de_gsm}</p>
      <p>Full Name: {telephoneLine.full_name}</p>
      <p>Code Entite: {telephoneLine.code_entite}</p>
      <p>Direction: {telephoneLine.direction}</p>
      <p>Fonction: {telephoneLine.fonction}</p>
      <p>Operateur: {telephoneLine.operateur}</p>
      <p>Categorie: {telephoneLine.categorie}</p>
      <p>Poste GSM: {telephoneLine.poste_GSM}</p>
    </div>
  );
};

export default TelephoneLineView;
